export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentDidMount(){
        console.log("i am mounted");
        const url = "http://www.localhost:8000/tennis/";
        fetch(url, {
            // mode: 'no-cors',
            method: 'GET',
            headers: {
              Accept: 'application/json',
            },
          },
        )
        .then(response => {
        if (response.ok) {
        response.json().then(json => {
        console.log(json);
        this.setState({tournaments:json});
        });
        }
        });
    }


    render() {
    // const tournamentItems= this.state.tournaments.map(tournament => <div>{tournament.participant1} &nbsp;  {tournament.participant2}</div>); 
        const tournamentItems=this.state.tournaments;   
    return <div>{tournamentItems}.map(function(tournament){ <div>{tournament.participant1} &nbsp;  {tournament.participant2}</div>}</div>;
    }

}
